# Khalakh, Tsuntinsky District, Republic of Dagestan

}}
Khalakh () is a rural locality (a selo) in Tsuntinsky District, Republic of Dagestan, Russia. Population:  There is 1 street in this selo.
Geography
Selo is located 159&nbsp;km from Makhachkala (capital of Dagestan) and 1,650&nbsp;km from Moscow. Shapikh is the nearest rural locality.
